import React from 'react'
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';


const Exercise = () => {
	return (
		<div>
			<Grid container>
				<Grid item sm>
					<Paper style={{padding: 20}}>
						Left Pane
					</Paper>
				</Grid>
				<Grid item sm>
					<Paper style={{padding: 20}}>
						Right Pane
					</Paper>
				</Grid>
			</Grid>
		</div>
		)
} 

export default Exercise;
